import React from 'react';
import {Navbar} from './Components/Navbar/Navbar'
import './App.css';
import 'Components/Navbar/navbar.css'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <div className="Page">
          <div id="Greeting">
            <h1 id="GreetingText">
              Hi,<br/>
              I'm Henry<br/>
              and I do <br/>
              all sorts <br/>
              of things.
            </h1>
          </div>
        </div>
    </div>
  );
}

export default App;
